description:
The beauties compete in the ultimate game of biology when they must correctly assemble a human body jigsaw puzzle made up of some of Australia's deadliest creepy crawlies. Meanwhile, the geeks strut their stuff as they participate in a real-life casting call to become the next big model for a well-known Australian men's underwear and swimwear brand.

PS- The reason this labeled &quot;Episode 5&quot; is my previous upload was a double and should have been called &quot;3 and 4&quot;
Enjoy :-)
